export interface IPageNavBarProp {
    
}

export interface IPageNavBarState {
    eventKey : any;
}

export class PageNavBar extends React.Component<IPageNavBarProp, IPageNavBarState> {
    state : IPageNavBarState = {eventKey : 1};
    props : IPageNavBarProp;
    constructor() {
        super();
        this.handleClick = this.handleClick.bind(this);
    }   
    
    handleClick(eventKey : any) {
        
        this.setState({
          eventKey:    eventKey
        });        
       
    
    }

    render() { 
        
        var divStyle = {
                "margin-left" : "2%" ,
                "height": "100%"
        };
        
        
        let uiComponent : any = null;
        
        
        
        if(this.state.eventKey == 1){
            uiComponent = < FilterableGridCalendar />
        }else  if(this.state.eventKey == 2){
            uiComponent= <FilterableProductTable 
                products = {PRODUCTS} defaultCategory = "Sporting Goods"  defaultRecordsPerPage = {10} />;
           
        }
        
        
        
        
        return (
        
        <div>
         <Navbar inverse collapseOnSelect>
       
        <Navbar.Collapse>
          <Nav>
            <NavItem eventKey={1} href="#" onSelect={this.handleClick} >Calendar</NavItem>
            <NavItem eventKey={2} href="#" onSelect={this.handleClick} >Table</NavItem>
            <NavDropdown eventKey={3} title="Dropdown" id="basic-nav-dropdown">
              <MenuItem eventKey={3.1} onSelect={this.handleClick}>Action</MenuItem>
              <MenuItem eventKey={3.2} onSelect={this.handleClick}>Another action</MenuItem>
              <MenuItem eventKey={3.3} onSelect={this.handleClick} >Something else here</MenuItem>
              <MenuItem divider />
              <MenuItem eventKey={3.3} onSelect={this.handleClick} >Separated link</MenuItem>
            </NavDropdown>
          </Nav>
          <Nav pullRight>
            <NavItem eventKey={4} href="#" onSelect={this.handleClick} >Settings</NavItem>
            <NavItem eventKey={5} href="#" onSelect={this.handleClick} >Logout</NavItem>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
            <div style={divStyle}  >
            {uiComponent}
            </div>
            
      </div>
        );
      }
    

}
	

